//Klasse Hello anlegen
class Hello {

//Klassenvariblen definieren
	def log;
	def context;
	def testRunner;

//Konstruktur der Klasse mit Variablen
//die Werte der Variablen werden auf die Klassenvariablen gesetzt
	def Hello (log, context, testRunner){
		this.log = log
		this.context = context
		this.testRunner = testRunner
	}
//Klassenmethode
	def sayHello(name){
		log.info (" Saying Hello "  +name);
	}
}

context.setProperty("Hello", new Hello(log,context,testRunner))

project = testRunner.testCase.testSuite.project ;
tcase = project.testSuites["TestSuite3"].testCases["TestCase1"] ; 
hello = tcase.getTestStepByName("Hello");

hello.run(testRunner, context)

context.Hello.sayHello("Elke")

project = testRunner.testCase.testSuite.project;
tcase = project.testSuites["TestSuite3"].testCases["TestCase2"];
tstep = tcase.getTestStepByName("GetCountryISOCode");

def status = tstep.run(testRunner, context)
//def status = testRunner.runTestStepByName("GetCountryISOCode")
log.info ("   >>>  "+status)
def result = status.getStatus().toString();
log.info ("  >>>   "+result)

if(result == "OK"){
	log.info(" >>> Test Passed")	
}else{
	log.info(" >>> Test Failed")	
}

//Aufruf eines bestimmten Testcases aus einem anderen Testcase
